import React, { useContext } from "react";
import { UserContext } from "../../context/context-api";

const DashboardPage = () => {
  const [state, setState] = useContext(UserContext);
  return (
    <div>
      <h1>Dashboard</h1>
      <h1>{JSON.stringify(state.user)}</h1>
    </div>
  );
};

export default DashboardPage;
